private TextTranslation translate(String text, String lang) throws IOException {
    Retrofit retrofit = new Retrofit.Builder().baseUrl("https://translate.yandex.net").addConverterFactory(GsonConverterFactory.create()).build();
    TranslationInterface translationInterface = retrofit.create(TranslationInterface.class);
    TextTranslation translation = translationInterface.translate(text, lang).execute().body();
    return translation;
}

