public static Matrix4 createTranslation(Vector3 translation) {
    Matrix4 result = new Matrix4().initIdentity();
    result.set(0, 3, translation.getX()).set(1, 3, translation.getY()).set(2, 3, translation.getZ());
    return result;
}

public static Matrix4 createTranslation(Vector3 translation, Matrix4 dest) {
    if (dest == null)
        dest = new Matrix4();
    Matrix4 result = dest.initIdentity();
    result.set(3, 0, translation.getX()).set(3, 1, translation.getY()).set(3, 2, translation.getZ());
    return result;
}

