private void updateTopView(float translationY) {
    if (translationY < 0.0f)
        translationY = 0.0f;
    else if (translationY > getTopViewMaxTranslationY())
        translationY = getTopViewMaxTranslationY();
    mTopView.setTranslationY(translationY);
    updateBottomView();
}

private void setTopViewTranslationY(float translationY, float minTanslationY) {
    if (translationY < minTanslationY)
        mTopViewTranslationY = minTanslationY;
    else if (translationY > getTopViewMaxTranslationY())
        mTopViewTranslationY = getTopViewMaxTranslationY();
    else
        mTopViewTranslationY = translationY;
    updateTopView(mTopViewTranslationY);
}

